import React from 'react'
import PropTypes from 'prop-types'
// import { Link } from 'react-router-dom'

export default function Navbar(props) {
    return (
        <nav className={`navbar navbar-expand-lg navbar-${props.mode} bg-${props.mode}`}>
  <div className="container-fluid">
    {/* <Link className="navbar-brand" to="/">{props.title}</Link> */}
    <a className="navbar-brand" href="#">{props.title}</a>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">
        <li className="nav-item">
          {/* <Link className="nav-link active" aria-current="page" to="/">Home</Link> */}
          <a className="nav-link active" aria-current="page" href="#">Home</a>
        </li>
        <li className="nav-item">
          {/* <Link className="nav-link" to="/about">{props.aboutText}</Link> */}
          {/* <a className="nav-link" href="/about">{props.aboutText}</a> */}
        </li>

      </ul>
      {/* <form classNameName="d-flex">
        <input classNameName="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
        <button classNameName="btn btn-success" type="submit">Search</button>
      </form> */}
        <div className={`form-check form-switch text-${props.mode==='light'?'dark':'light'}` }>
         <input className="form-check-input" onClick={props.toggleMode} type="checkbox" id="flexSwitchCheckDefault"/>
          <label className="form-check-label" htmlFor="flexSwitchCheckDefault">EnableDarkMode</label>
       </div>  


    </div>
  </div>
</nav>
    )
}


// Defining Values In A Prop
Navbar.propTypes={
    title: PropTypes.string.isRequired,
    aboutText: PropTypes.string.isRequired,
}


// Default Props

Navbar.defaultProps ={
    title: 'Set Title Here',
    aboutText:"About"
}
